import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import sdata from  './sdata';


function ncard(val){
   return (
    <Card 
    imgsrc = {val.imgsrc}
    title  = {val.title}
    stitle = {val.stitle}
    link   = {val.link}
   />
   )
}


ReactDOM.render(
  <>
    {sdata.map(ncard)}
  </>
  ,document.getElementById('root')
);
